import { useRouter } from 'next/router'
import Layout from '../components/Layout'


const Content = () => {
   	const router = useRouter();
   	return (
   		<>
   			<h1>{router.query.title}</h1>
   			<p>This is th eblog post page</p>
   		</>
   	);
};

const Page = () => {
	const router = useRouter();
	return(
		<Layout>
			<h1>{router.query.title}</h1>
			<p>This is the blog post.</p>
		</Layout>
	);
};

export default Page
